import React from 'react';

function SearchSuggestions(props) {
    return (
        <ul>
          { props.searchSuggestions.map((movie)=> {
            return (
            <li key={movie.Title}>{movie.Title}</li>
            )
          })}
        </ul>
    )
}

export default SearchSuggestions;
